sys_variable_value.value:
(function execute(inputs, outputs) {
var c = inputs.comp;
var b = inputs.ben;

var newC = c / 100;
var valRel = b * newC;


outputs.valrel = valRel;  
outputs.newc = newC;  




})(inputs, outputs);

